B.Qb=new A.e(B.c,["\u0907\u0926\u092e\u094d \u091c\u094d\u091e\u093e\u0928\u092e\u094d \u0909\u092a\u093e\u0936\u094d\u0930\u093f\u0924\u094d\u092f \u092e\u092e \u0938\u093e\u0927\u0930\u094d\u092e\u094d\u092f\u092e\u094d \u0906\u0917\u0924\u093e\u0903 \u0964\n\u0938\u0930\u094d\u0917\u0947\u093d\u092a\u093f \u0928 \u0909\u092a\u091c\u093e\u092f\u0928\u094d\u0924\u0947 \u092a\u094d\u0930\u0932\u092f\u0947 \u0928 \u0935\u094d\u092f\u0925\u0928\u094d\u0924\u093f \u091a \u0965 \u0968 \u0965","Having gained this knowledge, they achieve My characteristics. They are not born again even at the time of creation, nor do they perish when the universe perishes."],t.w)
