B.Vp=new A.e(B.c,["\u0924\u0938\u094d\u092e\u093e\u0924\u094d \u0936\u093e\u0938\u094d\u0924\u094d\u0930\u092e\u094d \u092a\u094d\u0930\u092e\u093e\u0923\u092e\u094d \u0924\u0947 \u0915\u093e\u0930\u094d\u092f\u093e\u0915\u093e\u0930\u094d\u092f \u0935\u094d\u092f\u0935\u0938\u094d\u0925\u093f\u0924\u094c \u0964\n\u091c\u094d\u091e\u093e\u0924\u094d\u0935\u093e \u0936\u093e\u0938\u094d\u0924\u094d\u0930 \u0935\u093f\u0927\u093e\u0928\u094b\u0915\u094d\u0924\u092e\u094d \u0915\u0930\u094d\u092e \u0915\u0930\u094d\u0924\u0941\u092e\u094d \u0907\u0939\u093e\u0930\u094d\u0939\u0938\u093f \u0965 \u0968\u096a \u0965","Hence, the scriptures are your authority in distinguishing actions that must and must not be done. Knowing the rules as told in the scriptures, you qualify to work here."],t.w)
