B.P0=new A.e(B.c,["\u0926\u093e\u0924\u0935\u094d\u092f\u092e\u094d \u0907\u0924\u093f \u092f\u0924\u094d \u0926\u093e\u0928\u092e\u094d \u0926\u0940\u092f\u0924\u0947 \u0905\u0928\u0941\u092a\u0915\u093e\u0930\u093f\u0923\u0947 \u0964\n\u0926\u0947\u0936\u0947 \u0915\u093e\u0932\u0947 \u091a \u092a\u093e\u0924\u094d\u0930\u0947 \u091a \u0924\u0924\u094d \u0926\u093e\u0928\u092e\u094d \u0938\u093e\u0924\u094d\u0935\u093f\u0915\u092e\u094d \u0938\u094d\u092e\u0943\u0924\u092e\u094d \u0965 \u0968\u0966 \u0965","Possessions that are given to the deserving who have not been of favor or assistance, at the appropriate place and time, with conviction - This charity is known to be in the quality of sattva ."],t.w)
